import "./About.css";
const About = () => {
  return (
    <div className="aboutPage">
      <h3>
        ვინ ვართ ჩვენ? - მარკეტერები, რომლებიც საქმის სუპერ პროფესიონალები ვართ.
        <span> ჩვენი ხედვა ესეთია: </span>მიაწოდე მომხმარებელს სიახლე, კრეატივი,
        ხარისხი და ემოცია.
      </h3>
    </div>
  );
};
export default About;
